from typing import Final, Tuple, List

from ctypes import c_uint32


def uint32_t(x: int):
    # Function to emulate casting to uint32_t in C
    # (allows us to ensure ints stay bounded by the same constraints as
    # uint32_t in C / C++)
    return c_uint32(x).value


# Generate Basic CRC32 Lookup Table (equivalent to 16-way switch in FSW -
# just there the C++ compiler builds it):
_g0: Final[int] = uint32_t(0xED_B8_83_20)
_g1: Final[int] = uint32_t(_g0 >> 1)
_g2: Final[int] = uint32_t(_g0 >> 2)
_g3: Final[int] = uint32_t(_g0 >> 3)
FSW_CRC_SWITCH_TABLE: Final[List[int]] = [
    uint32_t(0),
    uint32_t(_g3),
    uint32_t(_g2),
    uint32_t(_g2 ^ _g3),
    uint32_t(_g1),
    uint32_t(_g1 ^ _g3),
    uint32_t(_g1 ^ _g2),
    uint32_t(_g1 ^ _g2 ^ _g3),
    uint32_t(_g0),
    uint32_t(_g0 ^ _g3),
    uint32_t(_g0 ^ _g2),
    uint32_t(_g0 ^ _g2 ^ _g3),
    uint32_t(_g0 ^ _g1),
    uint32_t(_g0 ^ _g1 ^ _g3),
    uint32_t(_g0 ^ _g1 ^ _g2),
    uint32_t(_g0 ^ _g1 ^ _g2 ^ _g3)
]


def crc32_fsw(bufferData: bytes) -> int:
    """Exact clone of the CRC32 algorithm used in Iris FSW (specifically, code
    written by Iris - not FPrime or OS provided code. Namely, this is used in
    the NetworkManager at the time of writing.

     Computes the CRC32 of the given buffer.
     Runs in ~ 6 + 38*n (best of evaluated non-lookup-table-based methods).
     This is the only we'll use a CRC32 in the entire codebase, so it's not
     worth devoting precious RAM to it (if calculating on first call as in
     CRC32.hpp) and storing a giant static lookup table in flash is just
     asking for a cosmic bitflip to make this entire operation not work.

     NOTE: For BGAPI Passthrough, GSW should use this EXACT algorithm for
     CRC32 compute.

     NOTE: FSW-counterpart found in `fprime/CubeRover/NetworkManager/NetworkManager.cpp`.

     Derived from: https://web.archive.org/web/20190108202303/http://www.hackersdelight.org/hdcodetxt/crc.c.txt
     License: https://web.archive.org/web/20190716204559/http://www.hackersdelight.org/permissions.htm


    # Doctest examples confirmed to sync up with FSW results:
    >>> crc32_fsw(b'ImNetMan')
    2548205386
    >>> crc32_fsw(b'NetMan')
    2679180643
    >>> crc32_fsw(b'H')
    2852464175
    >>> crc32_fsw(b'HELLOmoonThisIsALongString')
    273146347

    # NOTE: \\ are necessary below for the escape sequences to get into doctest:
    # (these are testing [0x48] and [0xDE, 0xAD, 0xBE, 0xEF] respectively)

    >>> crc32_fsw(b'\\x48')
    2852464175

    >>> crc32_fsw(b'\\xDE\\xAD\\xBE\\xEF')
    2090640218
    """
    byte: int
    c: int

    i: int
    crc: int = uint32_t(0xFF_FF_FF_FF)
    bufferLen: int = len(bufferData)
    for i in range(0, bufferLen):
        # Get next byte.
        byte = uint32_t(bufferData[i])
        crc = uint32_t(crc ^ byte)
        for _ in [1, 0]:
            # Do two times.
            # Lookup table equivalent to 16-way switch
            c = uint32_t(FSW_CRC_SWITCH_TABLE[uint32_t(crc & 0xF)])
            crc = uint32_t(uint32_t(crc >> 4) ^ c)

    # For CRC32 we need to return the one's compliment of the result:
    crc = uint32_t(~crc)

    return crc


